import styled from 'styled-components';
import colors from './colors';

export default styled.div`
	padding-top: 40px;
	padding-left: 40px;
	padding-right: 40px;
	background-color: ${colors.darkerWhite};
	height: 100%;
	display: flex;
	flex-direction: column;
	position: static;
`;
